Алфави́т (др.-греч. ἀλφάβητος) — форма письменности, основанная на стандартном наборе знаков. В алфавите отдельные знаки — буквы обозначают фонемы языка, хотя однозначное соответствие звука букве наблюдают редко и имеет обыкновение утрачиваться в процессе развития устного языка. Алфавит отличается от пиктографического (идеографического) письма, где знаки обозначают понятия (шумерская клинопись) и от и логографического письма, где знаки обозначают отдельные морфемы (китайское письмо) или слова. Выделяют следующие разновидности алфавитов: 
* Консонантно-вокалические алфавиты — буквы обозначают как гласные, так и согласные; 
* Консонантные алфавиты — буквы обозначают только согласные, гласные могут обозначаться с помощью специальной системы диакритических знаков (огласовки); 
* Слоговые алфавиты — буквы обозначают целые слоги, причём слоги с одинаковой согласной, но разные гласные могут обозначаться близкими знаками (так называемые абугиды, типа индийского письма), а могут быть совершенно разными (например, кана); в узком смысле может не считаться алфавитом. Использование знаков для отдельных фонем ведёт к значительному упрощению письма в результате сокращения количества используемых знаков. Также, порядок букв в алфавите является основой алфавитной сортировки. Относительная сложность фонетических систем различных языков обуславливает наличие алфавитов неодинакового размера. Согласно Книге рекордов Гиннесса больше всего букв — 74 содержит алфавит кхмерского языка, наименьшее — 12 (a, e, g, i, k, o, p, r, s, t, u, v) в алфавите языка ротокас острова Бугенвиль (Папуа Новая Гвинея). Самой древней буквой алфавита является буква «о», которая осталась неизменной в том же виде, в каком она была принята в финикийском алфавите (около 1300 года до н. э., эта буква там обозначала согласный звук и обозначала «глаз» ('айн — буквально «око») и современная «о» произошла от неё).
